// 19:45 ~ 20:30

use std::collections::HashSet;

impl Solution {
    pub fn nearest_exit(mut maze: Vec<Vec<char>>, entrance: Vec<i32>) -> i32 {
        let mut exits: HashSet<(usize, usize)> = HashSet::new();
        for (i, x) in maze[0].iter().enumerate() {
            if *x == '.' {
                exits.insert((0, i));
            }
        }
        let last_i = maze.len() - 1;
        for (i, x) in maze[last_i as usize].iter().enumerate() {
            if *x == '.' {
                exits.insert((last_i, i));
            }
        }
        let last_j = maze[0].len() - 1;
        for i in 0..maze.len() {
            if maze[i][0] == '.' {
                exits.insert((i, 0));
            }
            if maze[i][last_j] == '.' {
                exits.insert((i, last_j));
            }
        }
        exits.remove(&(entrance[0] as usize, entrance[1] as usize));
        if exits.len() < 1 {
            return -1;
        }
        let mut min = usize::MAX;
        fn f(
            x: usize,
            y: usize,
            maze: &mut Vec<Vec<char>>,
            exits: &HashSet<(usize, usize)>,
            acc: usize,
            min: &mut usize,
        ) {
            // println!("({x}, {y})");
            if maze[x][y] != '.' {
                maze[x][y] = '=';
                return;
            }
            if exits.contains(&(x, y)) {
                *min = acc.min(*min);
            }
            let acc = acc + 1;
            if acc > *min {
                return;
            };
            maze[x][y] = '&';
            if x + 1 < maze.len() {
                f(x + 1, y, maze, exits, acc, min);
            }
            if y + 1 < maze[0].len() {
                f(x, y + 1, maze, exits, acc, min);
            }
            if x > 0 {
                f(x - 1, y, maze, exits, acc, min);
            }
            if y > 0 {
                f(x, y - 1, maze, exits, acc, min);
            }
            // maze[x][y] = '.';
        }
        f(
            entrance[0] as usize,
            entrance[1] as usize,
            &mut maze,
            &exits,
            0,
            &mut min,
        );
        if min == usize::MAX {
            -1
        } else {
            min as i32
        }
    }
}

